import React from 'react';
import TodoList from './TodoList.js';


export default class TodoApp extends React.Component{
    constructor(props){
        super(props);

        this.state = {
            items: []
        };

        this.handleClick = this.handleClick.bind(this);
        this.handleSubmit = this.handleSubmit.bind(this);
    }

    handleClick(e){
        this.setState({
            items: this.state.items.push()
        })
    }

    handleSubmit(e){

    }

    render(){
        return (
            <main className='jumbotron d-flex flex-column text-center'>
                <h3 className='display-4'>Todo List</h3>
                {/* <TodoList /> */}
                <div className="input-group w-25 mb-3 align-self-center">
                    <div className="input-group-prepend">
                        <button className="btn btn-outline-secondary" type="button" id="button-addon1" onClick={this.handleClick}>Button</button>
                    </div>
                    <input type="text" className="form-control" placeholder="" aria-label="Example text with button addon" aria-describedby="button-addon1" />
                </div>
            </main>
        )
    }
}
